import React, { useEffect} from 'react';
import { Box, Card, CardActions, CardContent, CardMedia, Button, Typography } from '@mui/material';
import {
    Link,
    Route,
    Routes,
    useParams
} from "react-router-dom";


const Shop = ({ allData,isReady }) => {
    
    if (!isReady) 
    {
        return (
            <p>Loading.............</p>
        )
    }
    
        return (
            <Box className="sliderProduct">
                {
                    allData.map(e => (
                    <Card className="childElementCard">
                        <CardActions>
                            <CardMedia
                                component="img"
                                alt="This is product"
                                className="imageCard"
                                image={e.images[5].imageUrl }
                            />
                            <CardContent>
                                <Typography gutterBottom variant="h6" component="div">
                                  {e.foodName}
                                </Typography>
                            </CardContent>
                        </CardActions>
                    </Card>
                ))
                    
              }
            </Box>
           
        )
};

export default Shop;
